script: |
  super -f text -I q6644.spq | sort > q6644.out

inputs:
  - name: q6644.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE - col2 / 83 * - col0 NOT BETWEEN - 25 AND + col1 + ( + - ( + 78 ) ) * col0;
  - name: tab0

outputs:
  - name: q6644.out
    data: |
      15	81	47
      87	21	10
      97	1	99
